import React, { useState } from 'react';
import './ManageUsers.css'; // Make sure to include your styles

const ManageUsers = () => {
    const [activities, setActivities] = useState([]);
    const [error, setError] = useState(null);

    useEffect(() => {
        const fetchUserActivities = async () => {
            try {
                const response = await fetch('http://localhost:8087/viewUsers', {
                    method: 'GET',
                    headers: {
                        'Authorization': `Bearer ${localStorage.getItem('token')}`,
                    }
                });

                if (!response.ok) {
                    throw new Error('Failed to fetch user activities');
                }

                const data = await response.json();
                setActivities(data);
            } catch (err) {
                setError(err.message);
            }
        };

        fetchUserActivities();
    }, []);

    if (error) {
        return <div>Error: {error}</div>;
    }


    return (
        <div className='view_user'>
        <main className="table" id="customers_table">
            <section className="table__header">
                <h1>Customer's Orders</h1>
                <div className="input-group">
                    <input
                        type="search"
                        placeholder="Search Data..."
                        value={""}
                        onChange={""}
                    />
                    <img src="images/search.png" alt="search" />
                </div>
                <div className="export__file">
                    <label htmlFor="export-file" className="export__file-btn" title="Export File"></label>
                    <input type="checkbox" id="export-file" />
                    <div className="export__file-options">
                        <label>Export As &nbsp; &#10140;</label>
                        <label htmlFor="export-file" id="toPDF">PDF <img src="images/pdf.png" alt="pdf" /></label>
                        <label htmlFor="export-file" id="toJSON">JSON <img src="images/json.png" alt="json" /></label>
                        <label htmlFor="export-file" id="toCSV">CSV <img src="images/csv.png" alt="csv" /></label>
                        <label htmlFor="export-file" id="toEXCEL">EXCEL <img src="images/excel.png" alt="excel" /></label>
                    </div>
                </div>
            </section>
            <section className="table__body">
                <table>
                    <thead>
                        <tr>
                            <th>Id <span className="icon-arrow">&UpArrow;</span></th>
                            <th>Customer <span className="icon-arrow">&UpArrow;</span></th>
                            <th>Location <span className="icon-arrow">&UpArrow;</span></th>
                            <th>Order Date <span className="icon-arrow">&UpArrow;</span></th>
                            <th>Status <span className="icon-arrow">&UpArrow;</span></th>
                            <th>Amount <span className="icon-arrow">&UpArrow;</span></th>
                        </tr>
                    </thead>
                    <tbody>
                        {activities.map(activity => (
                            <tr key={activity.id}>
                                <td>{activity.id}</td>
                                <td>{activity.customer}</td>
                                <td>{activity.location}</td>
                                <td>{activity.date}</td>
                                <td>
                                    <p >d</p>
                                </td>
                                <td><strong>$</strong></td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </section>
        </main>
        </div>
    );
};

export default ManageUsers;
